import { Routes, Route } from "react-router-dom";
import { useContext } from "react";
import { UserContext } from "../context";
import Home from "../JSX/Home";
import Teacher1 from "../Teacher/Teacher1";
import Teacher2 from "../Teacher/Teacher2";
import Teacher3 from "../Teacher/Teacher3";
import Teacher4 from "../Teacher/Teacher4";
import Teacher5 from "../Teacher/Teacher5";
import Teacher6 from "../Teacher/Teacher6";
import Teacher7 from "../Teacher/Teacher7";
import Teacher8 from "../Teacher/Teacher8";
import Teacher9 from "../Teacher/Teacher9";
import Teacher10 from "../Teacher/Teacher10";
import Teacher11 from "../Teacher/Teacher11";
import Teacher12 from "../Teacher/Teacher12";
import Teacher13 from "../Teacher/Teacher13";
import Teacher14 from "../Teacher/Teacher14";
import Movie from "../JSX/Movie";
import Schedule from "../JSX/Schedule";
import Plan from "../JSX/Plan";
import SignUpMethod from "../JSX/SignUpMethod";
import SignUp from "../JSX/SignUp";
import Download from "../JSX/Download";
import ContactUs from "../JSX/ContactUs";

function MainApp() {
  const teacher = useContext(UserContext);

  const teacherName = teacher.map((data) => data._id);
  return (
    <div className="mainApp">
      <Routes>
        <Route exact path="/" element={<Home />} />
        <Route path={`/${teacherName[0]}`} element={<Teacher1 />} />
        <Route path={`/${teacherName[1]}`} element={<Teacher2 />} />
        <Route path={`/${teacherName[2]}`} element={<Teacher3 />} />
        <Route path={`/${teacherName[3]}`} element={<Teacher4 />} />
        <Route path={`/${teacherName[4]}`} element={<Teacher5 />} />
        <Route path={`/${teacherName[5]}`} element={<Teacher6 />} />
        <Route path={`/${teacherName[6]}`} element={<Teacher7 />} />
        <Route path={`/${teacherName[7]}`} element={<Teacher8 />} />
        <Route path={`/${teacherName[8]}`} element={<Teacher9 />} />
        <Route path={`/${teacherName[9]}`} element={<Teacher10 />} />
        <Route path={`/${teacherName[10]}`} element={<Teacher11 />} />
        <Route path={`/${teacherName[11]}`} element={<Teacher12 />} />
        <Route path={`/${teacherName[12]}`} element={<Teacher13 />} />
        <Route path={`/${teacherName[13]}`} element={<Teacher14 />} />
        <Route path="/movie" element={<Movie />} />
        <Route path="/Schedule" element={<Schedule />} />
        <Route path="/Plan" element={<Plan />} />
        <Route path="/SignUpMethod" element={<SignUpMethod />} />
        <Route path="/SignUp" element={<SignUp />} />
        <Route path="/Download" element={<Download />} />
        <Route path="/ContactUs" element={<ContactUs />} />
      </Routes>
    </div>
  );
};

export default MainApp;
